import {useState} from "react";
import {Link} from "react-router-dom";
import axios from "axios";

export function BookAdd() {

  const [bookInfo, setBookInfo] = useState({
    bookName: '',
    bookType: ''
  })

  const onChangeBookAdd = (e) => {
    const {name, value} = e.target;

    const nextBookInfo = {
      ...bookInfo,
      [name]: value
    }

    setBookInfo(nextBookInfo);
  }

  function validateBookInfo(bookInfo) {
    if (bookInfo.bookName === '' || bookInfo.bookType === '') {
      alert("입력값을 확인해주세요!");
      return false;
    }

    return true;
  }

  const onclickBookAdd = () => {
    if (validateBookInfo(bookInfo)) {
      axios
      .post("http://localhost:8080/api/v1/books", JSON.stringify(bookInfo), {
        headers: {
          "Content-Type": `application/json`,
        },
      }).then(function (response) {
        console.log("responseStatus : " + response.status);
        console.log("console.data : " + response.data);
        console.log(response);
      })
      .catch(function (errorResponse) {
        console.log("status :" + errorResponse.response.status);
        console.log(errorResponse.response.data);
        alert(errorResponse.response.data.message);
      });

    }

  }

  const optionValue = ["COMPUTER", "SCIENCE", "ECONOMY", "COMIC", "SPORTS"]

  return (
      <div className="wrapper">
        <div className="nav">
          <div className="header_left">
            <p>도서관리 애플리케이션</p>
          </div>
          <div className="header_right">
            <a href="#" className="btn1">등록하기</a>
            <a href="#" className="btn2">목록</a>
          </div>
        </div>
        <div className="container">
          <div className="fir_box content_box">
            <div className="content">
              <img src=""/>
                <p className="title">사용자 등록</p>
                <div className="input_box">
                  <p>이름</p>
                  <input/>
                </div>
                <div className="input_box">
                  <p>나이</p>
                  <input/>
                </div>
                <button className="save">저장</button>
            </div>
          </div>
          <div className="sec_box content_box">
            <div className="content">
              <img src=""/>
                <p className="title">책 등록</p>
                <div className="input_box">
                  <p>책 이름</p>
                  <input/>
                </div>
                <div className="input_box">
                  <p>책 유형</p>
                  <select defaultValue="default" name="bookType"
                          aria-label="옵션선택">
                  </select>
                </div>
                <button className="save">저장</button>
            </div>
          </div>
          <div className="thi_box content_box">
            <div className="content">
              <img src=""/>
                <p className="title">책 대출</p>
                <div className="input_box">
                  <p>이름</p>
                  <input/>
                </div>
                <div className="input_box">
                  <p>책 이름</p>
                  <input/>
                </div>
                <button className="save">저장</button>
            </div>
          </div>
          <div className="fou_box content_box">
            <div className="content">
              <img src=""/>
                <p className="title">책 반납</p>
                <div className="input_box">
                  <p>이름</p>
                  <input/>
                </div>
                <div className="input_box">
                  <p>책이름</p>
                  <input/>
                </div>
                <button className="save">저장</button>
            </div>
          </div>
        </div>
      </div>



  );
}
